package leetcode.easy;

/**
 * Created on 2019/6/21.
 * <p>
 * 387. First Unique Character in a String
 * Given a string, find the first non-repeating character in it and return it's index. If it doesn't exist, return -1.
 * <p>
 * <p>
 * Examples:
 * s = "leetcode"
 * return 0.
 * <p>
 * s = "loveleetcode",
 * return 2.
 * <p>
 * Note: You may assume the string contain only lowercase letters.
 */

public class FirstUniqueCharacterinaString {
    public static void main(String[] args) {
        String input1 = "";
        System.out.println("output1: " + getBetterResult(input1));

        String input2 = "loveleetcode";
        //System.out.println("output2: " + getMyResult(input2));
    }

    /**
     * Runtime: 15 ms, faster than 58.89% of Java online submissions for First Unique Character in a String.
     * Memory Usage: 38.2 MB, less than 98.48% of Java online submissions for First Unique Character in a String.
     */
    private static int getMyResult(String s) {
        for (int i = 0; i < s.length(); i++) {
            if (s.indexOf(s.charAt(i)) == s.lastIndexOf(s.charAt(i)))
                return i;
        }
        return -1;
    }

    private static int getBetterResult(String s) {
        int[] cache = new int[26];
        for (char c : s.toCharArray())
            cache[c - 'a']++;
        for (int i = 0; i < s.length(); i++) {
            if (cache[s.charAt(i) - 'a'] == 1) return i;
        }
        return -1;
    }
}